import React, { useState } from 'react';
import Button from 'react-bootstrap/Button'
import ListGroup from 'react-bootstrap/ListGroup';
import InputGroup from 'react-bootstrap/InputGroup';    
import FormControl from 'react-bootstrap/FormControl';    
import '../styles/ShuffleTimeList.css';
import { Form } from 'react-bootstrap';

const ShuffleTimeList = (props) => { 
    const { shuffleList, setShuffleList, participant } = props;

    return (
        <Form.Group controlId={`participant-${participant}`}>
            <Form.Label>{participant}</Form.Label>
            <Form.Control type="string" placeholder="# of Participants" />
        </Form.Group>
    )
}

export default ShuffleTimeList;
